      <p className="card-price">$ 100.00</p>
      <div className="rating-container">
        <img className="rating" src="./images/ratings/star.png" alt="rating" />
        <img className="rating" src="./images/ratings/star.png" alt="rating" />
        <img className="rating" src="./images/ratings/star.png" alt="rating" />
        <img className="rating" src="./images/ratings/star.png" alt="rating" />
        <img className="rating" src="./images/ratings/star.png" alt="rating" />
        <span className="card-reviewers-numbers">(2.8k)</span>
      </div>
    </div>
  );
}
